import React, {Component} from 'react';
import "./header.scss"
import logo from "./assets/a-logo.png"
import changeMoney from "./assets/Frame 2.svg"
import emptyCart from "./assets/Empty Cart.svg"
import {Link} from "react-router-dom";

class Header extends Component{
    render () {
        const menuItems = [{value:"WOMEN", link:"/women"},{value:"MEN", link:"/men"},{value:"KIDS", link:"/kids"}]
        return(
            <>
        <div className="header__container">
            <div className="header__menu">
                    {menuItems.map((item, index) => (
                            <Link to={item.link}  className="header__menu_items" key={index}>{item.value}</Link>
                    ))}
            </div>
            <div className="header__card">
                <img src={changeMoney} alt="change-money"/>
                <img src={emptyCart} alt="empty-cart"/>
            </div>
            </div>
            <div className="header__logo"><img src={logo} alt="logo"/></div>
            </>
        )
    }
}

export default Header
